  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The overall goal of the project
  is to demonstrate cost efficient cryogenic operations on a relevant scale that can
  be projected onto future Spaceport architectures and extraterrestrial surface operations.
  This goal will be demonstrated by completing the primary test objectives below:
  GODU Integrated Refrigeration and Storage (IRAS) &amp;bull; Demonstrate zero loss
  storage and transfer of LH2 at a large scale. &amp;bull; Demonstrate hydrogen densification
  in storage tank and loading of flight tank &amp;bull; Demonstrate in situ hydrogen
  liquefaction using helium refrigeration GODU Autonomous Control of Cryogenic Propellant
  Load &amp;bull; Demonstrate autonomous control of a sub-scale vehicle loading operation
  &amp;bull; Demonstrate recognition of common system faults and anomalies and recover
  without human intervention &amp;bull; Evaluate tools and techniques in real world
  application to advance health management and autonomous control technologies for
  future applications &amp;bull; Demonstrate scalability and extensibility by replicating
  autonomous control of the 6,000 gallon LOX simulator system to the 33,000 gallon
  LH2 system &amp;bull; Develop and demonstrate helium conservation instrumentation
  and processes &amp;bull; Provide potential hardware in the loop demonstration capability
  for AES Automated Mission Operations project or other analog test environment for
  remote operations in 2014&lt;/p&gt;\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
